import { FiPlusSquare } from 'react-icons/fi';
import { Container } from './styles';
import Startinha from '../../assets/Startinha.png';

interface HeaderProps {
  openModal: () => void;
}

export default function Header({ openModal }: HeaderProps) {
  return (
    <Container>
      <header>
        <img src={Startinha} width="600px" height="600px" alt="Startinha" />
        <nav>
          <div>
            <button
              type="button"
              onClick={openModal}
            >
              <div className="text">Novo Prato</div>
              <div className="icon">
                <FiPlusSquare size={24} />
              </div>
            </button>
          </div>
        </nav>
      </header>
    </Container>
  )
}
